from sympy import primerange
def sd(s): return sum(map(int, s))
def auptod(digits):
    alst = []
    for d in range(2, digits+1, 2):
        for p in primerange(10**(d-1), 10**d):
            s = str(p)
            if sd(s[:len(s)//2]) == sd(s[len(s)//2:]): alst.append(p)
    return alst
